 import './App.css';
import Footer from './compoents/footer';
import Header from './compoents/header';
import Home from './pages/home';
import { BrowserRouter as Router,Routes, Route } from "react-router-dom";
function App() {
  return (

<div className='App'>


  <Router>

    <div>
    <Header/>

    <Routes>
      <Route  path="/"  element={ <Home/>}/>
    </Routes>

    </div>

  </Router>
<Home/>
 <Footer/>
</div>


  );
}

export default App;
